import React from 'react';
import './App.css';



const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjFMReJvcQ0Z1pD2h1FXmwqJT8BSii9W8FlQ&usqp=CAU" />
      </header>
      <nav className="nav">
        <div><a>Profile</a></div>
        <div><a>Messeges</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
        <div><a>Settings</a></div>
      </nav>
      <div className="content">
				<img src='https://www.industrialempathy.com/img/remote/ZiClJf-1920w.jpg'/>
			</div>
    </div>
  );
}



export default App;
